import React, { useRef } from 'react';

function HOC_Overlay(Component: React.ElementType<any>){

    const reff = useRef<any>();

    return (props: any)=>{

        return(
        <div className='HOC_overlay' onClick={(e)=>{console.log(reff.current==e.target)}} ref={reff}>
            <Component {...props}/>
        </div>
        )
    }

}

export default HOC_Overlay;
